(407, 'wpforms_notifications', 'a:4:{s:6:\"update\";i:1662669384;s:4:\"feed\";a:0:{}s:6:\"events\";a:6:{s:22:\"wp-mail-smtp-education\";a:5:{s:2:\"id\";s:22:\"wp-mail-smtp-education\";s:5:\"title\";s:71:\"¡No pierdas tus correos electrónicos de notificación de formularios!\";s:7:\"content\";s:329:\"¿Sabías que muchos sitios de WordPress no están bien configurados para enviar correos electrónicos? Con el plugin gratuito WP Mail SMTP, puedes optimizar fácilmente tu sitio para enviar correos electrónicos, evitar la carpeta de spam y asegurarte de que tus correos lleguen siempre a la bandeja de entrada del destinatario.\";s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:57:\"http://sidiagro.test/wp-admin/admin.php?page=wpforms-smtp\";s:4:\"text\";s:14:\"Instalar ahora\";}s:3:\"alt\";a:2:{s:3:\"url\";s:195:\"https://wpforms.com/docs/how-to-set-up-smtp-using-the-wp-mail-smtp-plugin/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=WP%20Mail%20SMTP%20Learn%20More\";s:4:\"text\";s:12:\"Aprende más\";}}s:5:\"start\";s:19:\"2022-08-20 20:39:44\";}s:15:\"join-vip-circle\";a:5:{s:2:\"id\";s:15:\"join-vip-circle\";s:5:\"title\";s:37:\"¿Quieres ser un VIP? ¡Únete ahora!\";s:7:\"content\";s:394:\"Dirigir un sitio de WordPress puede ser un reto. ¡Pero la ayuda está a la vuelta de la esquina! ¡Nuestro grupo de Facebook contiene toneladas de consejos y ayuda para que tu negocio crezca! Al unirte a nuestro Círculo VIP, obtendrás acceso instantáneo a consejos, trucos y respuestas de una comunidad de fieles usuarios de WPForms. ¡Lo mejor de todo es que la afiliación es 100% gratis!\";s:4:\"btns\";a:1:{s:4:\"main\";a:2:{s:3:\"url\";s:43:\"https://www.facebook.com/groups/wpformsvip/\";s:4:\"text\";s:12:\"Únete ahora\";}}s:5:\"start\";s:19:\"2022-09-16 20:39:44\";}s:14:\"survey-reports\";a:5:{s:2:\"id\";s:14:\"survey-reports\";s:5:\"title\";s:54:\"¿Quieres saber lo que realmente piensan tus clientes?\";s:7:\"content\";s:416:\"No hay nada mejor que los comentarios reales de tus clientes y visitantes. Por eso muchas pequeñas empresas adoran nuestro impresionante complemento de Encuestas y Sondeos. Desbloquea al instante los informes completos de las encuestas directamente en tu panel de control de WordPress. Y no lo olvides: crear una encuesta es fácil con nuestras plantillas prediseñadas, ¡así que podrás empezar en pocos minutos!\";s:4:\"btns\";a:2:{s:4:\"main\";a:1:{s:7:\"license\";a:5:{s:4:\"lite\";a:2:{s:3:\"url\";s:161:\"https://wpforms.com/lite-upgrade/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Upgrade%20Lite\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:5:\"basic\";a:2:{s:3:\"url\";s:166:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:4:\"plus\";a:2:{s:3:\"url\";s:166:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:3:\"pro\";a:2:{s:3:\"url\";s:59:\"http://sidiagro.test/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:14:\"Instalar ahora\";}s:5:\"elite\";a:2:{s:3:\"url\";s:59:\"http://sidiagro.test/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:14:\"Instalar ahora\";}}}s:3:\"alt\";a:2:{s:3:\"url\";s:202:\"https://wpforms.com/docs/how-to-install-and-use-the-surveys-and-polls-addon/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Learn%20More\";s:4:\"text\";s:12:\"Aprende más\";}}s:5:\"start\";s:19:\"2022-10-01 20:39:44\";}s:16:\"form-abandonment\";a:5:{s:2:\"id\";s:16:\"form-abandonment\";s:5:\"title\";s:57:\"¡Consigue más clientes potenciales con tus formularios!\";s:7:\"content\";s:463:\"¿Tus formularios convierten menos visitantes de lo que esperabas? A menudo, los visitantes abandonan los formularios a mitad de camino. Esto puede impedirte obtener todos los clientes potenciales que mereces captar. Con nuestra extensión de abandono de formularios, puedes capturar entradas parciales, ¡incluso si el visitante no ha pulsado Enviar! A partir de ahí, es fácil hacer un seguimiento de los clientes potenciales y convertirlos en clientes fieles.\";s:4:\"btns\";a:2:{s:4:\"main\";a:1:{s:7:\"license\";a:5:{s:4:\"lite\";a:2:{s:3:\"url\";s:158:\"https://wpforms.com/lite-upgrade/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Upgrade%20Lite\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:5:\"basic\";a:2:{s:3:\"url\";s:163:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:4:\"plus\";a:2:{s:3:\"url\";s:163:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:3:\"pro\";a:2:{s:3:\"url\";s:59:\"http://sidiagro.test/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:14:\"Instalar ahora\";}s:5:\"elite\";a:2:{s:3:\"url\";s:59:\"http://sidiagro.test/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:14:\"Instalar ahora\";}}}s:3:\"alt\";a:2:{s:3:\"url\";s:201:\"https://wpforms.com/docs/how-to-install-and-use-form-abandonment-with-wpforms/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Learn%20More\";s:4:\"text\";s:12:\"Aprende más\";}}s:5:\"start\";s:19:\"2022-10-16 20:39:44\";}s:21:\"translation-community\";a:5:{s:2:\"id\";s:21:\"translation-community\";s:5:\"title\";s:50:\"¡WPForms necesita tus habilidades de traducción!\";s:7:\"content\";s:293:\"¿Sabías que WPForms tiene su propia Comunidad de Traductores? Estamos buscando traductores cualificados para ayudar a que WPForms sea realmente accesible para nuestros millones de usuarios en todo el mundo. Puedes ganar un botín de WPForms y una licencia Pro gratuita. ¿Quieres participar?\";s:4:\"btns\";a:1:{s:4:\"main\";a:2:{s:3:\"url\";s:30:\"https://wpforms.com/translate/\";s:4:\"text\";s:12:\"Únete ahora\";}}s:5:\"start\";s:19:\"2022-11-15 20:39:44\";}s:5:\"ideas\";a:5:{s:2:\"id\";s:5:\"ideas\";s:5:\"title\";s:49:\"¿Cuál es tu característica soñada de WPForms?\";s:7:\"content\";s:329:\"Si pudieras añadir una sola función a WPForms, ¿cuál sería? ¡Queremos saberlo! Nuestro equipo está ocupado encuestando a valiosos clientes como tú mientras planeamos el año que viene. Nos encantaría saber qué funciones llevarían a tu negocio al siguiente nivel ¿Tienes un segundo para compartir tu idea con nosotros?\";s:4:\"btns\";a:1:{s:4:\"main\";a:2:{s:3:\"url\";s:36:\"https://wpforms.com/share-your-idea/\";s:4:\"text\";s:16:\"Comparte tu idea\";}}s:5:\"start\";s:19:\"2022-12-15 20:39:44\";}}s:9:\"dismissed\";a:0:{}}', 'yes'),
